import MenuItem from "./MenuItem"

function MenuContainer({menuItems}){

    const itemComponents = menuItems.map((item) => <MenuItem key={item.id} item={item}/>)
    return(
        <>
           {itemComponents}
        </>
    )
}
export default MenuContainer;
